description:
Nar Frank Cordell (Morgan Freeman) kommer flytande i alven, sammanfangslad
med en doende polis, ar det Ray Keene (John Cusack) som hjalper dem upp ur
vattnet. Ray ar ovetandes om att han just raddat livet pa en lonnmordare som
ar pa flykt fran rattvisan...
